import React, { Component } from "react";
import TextField from "@material-ui/core/TextField";
import Autocomplete from "@material-ui/lab/Autocomplete";

class SearchBox extends Component {
  state = { searchedUsers: [] };

  render() {
    return (
      <Autocomplete
        id="free-solo-demo"
        freeSolo
        options={
          searchedUsers && searchedUsers.map((option) => option.display_name)
        }
        renderInput={(params) => (
          <TextField
            {...params}
            label="freeSolo"
            margin="normal"
            variant="outlined"
          />
        )}
      />
    );
  }
}

export default SearchBox;
